def cluster_single_frame(frame_df):
    # clustered_data = pd.DataFrame(columns=frame_df.columns)

    group_data = frame_df[['Range', 'Azimuth', 'Elevation']]
    scaler = StandardScaler()
    scaled_data = scaler.fit_transform(group_data)

    dbscan = DBSCAN(eps=1, min_samples=3)
    clusters = dbscan.fit_predict(scaled_data)
    frame_df['cluster'] = clusters
    # frame_df = frame_df.sort_values(by='cluster')
    # clustered_data = pd.concat([clustered_data.dropna(axis=1, how='all'), frame_df.dropna(axis=1, how='all')])
    # clustered_data = frame_df[frame_df['cluster'] != -1].reset_index().drop(columns='index')
    clustered_data = frame_df[frame_df['cluster'] != -1]

    means_df = clustered_data.groupby('cluster')[['Range', 'Azimuth', 'Elevation']].mean()
    means = means_df.values.tolist()

    return (True, means)

max_val = data['frameNum'].max()
frame_df = data.loc[data['frameNum'] == max_val]
frame_df = frame_df.drop(columns=['frameNum'])

# print(frame_df)
print(cluster_single_frame(frame_df))
